  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Vaccine Adverse Event Reporting System
  (VAERS) online database on CDC WONDER provides counts and percentages of adverse
  event case reports after vaccination, received since January 1990 through last month.
  Data are available by symptom, vaccine product, manufacturer, onset interval, outcome
  category, year and month vaccinated, year and month reported, age, sex and state
  / territory. The Vaccine Adverse Event Reporting System is a cooperative program
  for vaccine safety of the Centers for Disease Control and Prevention (CDC) and the
  Food and Drug Administration (FDA). VAERS is a post-marketing safety surveillance
  program, collecting information about adverse events (possible side effects) that
  occur after the administration of US licensed vaccines. Data are from the US Department
  of Health and Human Services (DHHS), Public Health Service (PHS), Food and Drug
  Administration (FDA)/ Centers for Disease Control (CDC), Vaccine Adverse Event Reporting
  System (VAERS).</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
